import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [message, setMessage] = useState('');
  const [messages, setMessages] = useState([
    {
      id: 1,
      text: "Hello! Welcome to Meesho! I'm your shopping assistant. How can I help you today?",
      sender: 'bot',
      timestamp: new Date()
    }
  ]);
  const [loading, setLoading] = useState(false);

  const sendMessage = async () => {
    if (!message.trim()) return;

    // Add user message
    const userMessage = {
      id: Date.now(),
      text: message,
      sender: 'user',
      timestamp: new Date()
    };

    setMessages(prev => [...prev, userMessage]);
    setMessage('');
    setLoading(true);

    try {
      const response = await axios.post('http://localhost:3000/api/webhook', {
        queryResult: { queryText: message }
      });

      // Add bot response
      const botMessage = {
        id: Date.now() + 1,
        text: response.data.fulfillmentText,
        sender: 'bot',
        timestamp: new Date()
      };

      setMessages(prev => [...prev, botMessage]);
    } catch (error) {
      const errorMessage = {
        id: Date.now() + 1,
        text: 'Sorry, I could not connect to the server. Please make sure the backend is running on http://localhost:3000',
        sender: 'bot',
        timestamp: new Date(),
        isError: true
      };
      setMessages(prev => [...prev, errorMessage]);
    }

    setLoading(false);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      sendMessage();
    }
  };

  const quickReplies = ['Find products', 'Track my order', 'Get recommendations'];

  const handleQuickReply = (reply) => {
    setMessage(reply);
    // Use a callback in setState to ensure the message is updated before sending
    setMessage(reply, () => {
      sendMessage();
    });
  };

  return (
    <div className="App">
      <div className="chat-container">
        <div className="chat-header">
          <h1>🛍️ Meesho Shopping Assistant</h1>
          <p>Your AI-powered shopping companion</p>
          <div className="status-indicator">
            <span className="status-dot"></span>
            Online
          </div>
        </div>

        <div className="messages-container">
          {messages.map((msg) => (
            <div key={msg.id} className={`message ${msg.sender}`}>
              <div className={`message-content ${msg.isError ? 'error' : ''}`}>
                {msg.text}
              </div>
              <div className="message-time">
                {msg.timestamp.toLocaleTimeString()}
              </div>
            </div>
          ))}
          
          {loading && (
            <div className="message bot">
              <div className="message-content">
                <div className="typing-indicator">
                  <span></span>
                  <span></span>
                  <span></span>
                </div>
              </div>
            </div>
          )}

          {messages.length === 1 && (
            <div className="quick-replies">
              <p>Try these options:</p>
              <div className="quick-replies-buttons">
                {quickReplies.map((reply, index) => (
                  <button 
                    key={index}
                    onClick={() => handleQuickReply(reply)}
                    className="quick-reply-btn"
                  >
                    {reply}
                  </button>
                ))}
              </div>
            </div>
          )}
        </div>

        <div className="input-container">
          <input
            type="text"
            value={message}
            onChange={(e) => setMessage(e.target.value)}
            onKeyPress={handleKeyPress}
            placeholder="Type your message here..."
            disabled={loading}
          />
          <button onClick={sendMessage} disabled={loading || !message.trim()}>
            {loading ? '...' : 'Send'}
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
